(3, 'This is the *first* editor.\r\n------------------------------\r\n\r\nJust plain **Markdown**, except that the input is sanitized:\r\n\r\n<marquee>I''m the ghost from the past!</marquee>\r\n', '20/6/2015', 11, NULL, 'My First Blog Post {JAVATRON}'),
(4, '* Python창??s with statement was first introduced five years ago, in Python 2.5.<br> \r\nIt창??s handy when you have two related operations which you창??d like to execute as a pair, with a block of code in between..<br> \r\n The classic example is opening a file, manipulating the file, then closing it:.<br> \r\n\r\n    with open(''output.txt'', ''w'') as f:\r\n    f.write(''Hi there!'')\r\n', '20/6/2015', 11, NULL, 'The Python "with" Statement by Example'),
(5, 'This is the *first* editor.\r\n------------------------------\r\n\r\nJust plain **Markdown**, except that the input is sanitized:\r\n\r\n<marquee>I''m the ghost from the past!</marquee>\r\n', '20/6/2015', 9, NULL, 'THIS IS FOR TEST'),
(6, '* A Java servlet is a Java programming language program that extends the capabilities of a server.<br>\r\n Although servlets can respond to any types of requests, they most commonly implement applications hosted on Web servers.[1] <br>\r\nSuch Web servlets are the Java counterpart to other dynamic Web content technologies such as PHP and ASP.NET.<br>\r\n\r\n\r\n* Three methods are central to the life cycle of a servlet.<br>\r\n These are init(), service(), and destroy().<br>\r\n They are implemented by every servlet and are invoked at specific times by the server.', '20/6/2015', 12, NULL, 'Java servlet '),
(7, '* JavaServer Pages (JSP) is a technology that helps software developers create dynamically generated web pages based on HTML, XML, or other document<br> types. Released in 1999 by Sun Microsystems,[1] JSP is similar to PHP, but it uses the Java programming language.<br>\r\n\r\n* To deploy and run JavaServer Pages, a compatible web server with a servlet container, such as Apache Tomcat or Jetty, is required.', '20/6/2015', 12, NULL, 'JavaServer Pages '),
(8, '* Welcome! Are you completely new to programming? If not then we presume you will be looking for information about why and how to get started with Python. Fortunately an experienced programmer in any programming language (whatever it may be) can pick up Python very quickly. It''s also easy for beginners to use and learn, so jump in!\r\n\r\n* Installing\r\nInstalling Python is generally easy, and nowadays many Linux and UNIX distributions include a recent Python. Even some Windows computers (notably those from HP) now come with Python already installed. If you do need to install Python and aren''t confident about the task you can find a few notes on the BeginnersGuide/Download wiki page, but installation is unremarkable on most platforms.\r\n\r\n* Learning\r\nBefore getting started, you may want to find out which IDEs and text editors are tailored to make Python editing easy, browse the list of introductory books, or look at code samples that you might find helpful.\r\n\r\n* There is a list of tutorials suitable for experienced programmers on the BeginnersGuide/Tutorials page. There is also a list of resources in other languages which might be useful if English is not your first language.\r\n\r\n* The online documentation is your first port of call for definitive information. There is a fairly brief tutorial that gives you basic information about the language and gets you started. You can follow this by looking at the library reference for a full description of Python''s many libraries and the language reference for a complete (though somewhat dry) explanation of Python''s syntax. If you are looking for common Python recipes and patterns, you can browse the ActiveState Python Cookbook\r\n\r\n* Looking for Something Specific?\r\nIf you want to know whether a particular application, or a library with particular functionality, is available in Python there are a number of possible sources of information. The Python web site provides a Python Package Index (also known as the Cheese Shop, a reference to the Monty Python script of that name). There is also a search page for a number of sources of Python-related information. Failing that, just Google for a phrase including the word ''''python'''' and you may well get the result you need. If all else fails, ask on the python newsgroup and there''s a good chance someone will put you on the right track.', '20/6/2015', 13, NULL, 'Python For Beginners'),
(9, ' <h4><ul><li>"Never take a mean advantage of anyone in any transaction, and never be hard upon people who are in your power. Try to do to others, as you would have them do to you, and do not be discouraged if they fail sometimes."\r\nCHARLES DICKENS (1812-1870) in a letter written in 1868 to his youngest son, Edward Bulwer Lytton (nicknamed Plorn) when he was leaving to attend university in Australia. Dickens, incidentally, is responsible for the finest surrogate father in literature: Joe Gargery in Great Expectations, who says: "Which dear old Pip, old chap, you and me was ever friends. And when you''re well enough to go out for a ride 창?? what larks."</li></ul></h4>\r\n\r\n<br><br><br>\r\n<h3><ul><li>"It is a wise father that knows his own child."\r\nWILLIAM SHAKESPEARE (1564-1616), the man who created King Lear, who also said: "When a father gives to his son, both laugh; when a son gives to his father, both cry."\r\n</li></ul></h3>', '21/6/2015', 9, NULL, 'Charles Dickens - Father''s Day: 20 uplifting quotes'),
