(13, '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd"><html dir=''ltr''><head><meta content=''text/html; charset=UTF-8'' http-equiv=''Content-Type''/><meta content=''blogger'' name=''generator''/><link href=''http://philosophyforprogrammers.blogspot.in/favicon.ico'' rel=''icon'' type=''image/x-icon''/><link href=''http://philosophyforprogrammers.blogspot.com/2014/09/ridiculous-math-shit-which-ethics.html'' rel=''canonical''/><link rel="alternate" type="application/atom+xml" title="P4P - Atom" href="http://philosophyforprogrammers.blogspot.com/feeds/posts/default" /><link rel="alternate" type="application/rss+xml" title="P4P - RSS" href="http://philosophyforprogrammers.blogspot.com/feeds/posts/default?alt=rss" /><link rel="service.post" type="application/atom+xml" title="P4P - Atom" href="http://www.blogger.com/feeds/6172724226008713264/posts/default" /><link rel="alternate" type="application/atom+xml" title="P4P - Atom" href="http://philosophyforprogrammers.blogspot.com/feeds/475836906009144242/comments/default" /><link href=''http://3.bp.blogspot.com/-5vVL0_OXEEI/VBR-0h_VTNI/AAAAAAAAATQ/AIkb_AWuouw/s1600/kitty_tossup.jpg'' rel=''image_src''/><title>P4P: Ridiculous math things which Ethics shouldn''t depend on but does</title><link type=''text/css'' rel=''stylesheet'' href=''https://www.blogger.com/static/v1/widgets/1943648796-widget_css_bundle.css'' /><link type=''text/css'' rel=''stylesheet'' href=''https://www.blogger.com/dyn-css/authorization.css?targetBlogID=6172724226008713264&zx=8a3c36c7-81d6-482d-87b0-24df4bbdd6b6'' /></head><body><div class=''navbar section'' id=''navbar''><div class=''widget Navbar'' id=''Navbar1''><div id="navbar-iframe-container"></div></div></div><div id=''outer-wrapper''><div id=''wrap2''><span id=''skiplinks'' style=''display:none;''><a href=''#main''>skip to main </a> |      <a href=''#sidebar''>skip to sidebar</a></span><div id=''header-wrapper''><div class=''header section'' id=''header''><div class=''widget Header'' id=''Header1''><div id=''header-inner''><div class=''titlewrapper''><h1 class=''title''><a href=''http://philosophyforprogrammers.blogspot.in/''>P4P</a></h1></div><div class=''descriptionwrapper''><p class=''description''><span></span></p></div></div></div></div></div><div id=''content-wrapper''><div id=''crosscol-wrapper'' style=''text-align:center''><div class=''crosscol section'' id=''crosscol''></div></div><div id=''main-wrapper''><div class=''main section'' id=''main''><div class=''widget Blog'' id=''Blog1''><div class=''blog-posts hfeed''><!-- google_ad_section_start(name=default) -->          <div class="date-outer">                  <div class="date-posts">        <div class=''post-outer''><div class=''post hentry''><a name=''475836906009144242''></a><h3 class=''post-title entry-title''>Ridiculous math things which Ethics shouldn''t depend on but does</h3><div class=''post-header''><div class=''post-header-line-1''></div></div><div class=''post-body entry-content''>There is a scene in Gulliver''s Travels where the protagonist calls up the ghosts of all the philosophers since Aristotle, and the ghosts all admit that Aristotle was way better than them at everything. Especially Descartes &#8211; Jonathan Swift wants to make very clear that Aristotle is a way better philosopher than Descartes, and that all of Descartes''s ideas are stupid. (I think this was supposed to prove a point in some long-forgotten religious dispute.)<br /><br />If I ever become a prominent philosopher and we develop the technology to call up ghosts in order to win points in literary holy wars (I will let the reader decide which of those two conditions is more likely), please reincarnate me to&nbsp;talk ethics with Aristotle. Basically all the problems I''m worried about deal with mathematical concepts which weren''t developed until around a century ago, and I''m excited to hear whether a <a href="http://en.wikipedia.org/wiki/Aristotelian_ethics">virtuous person</a> would accept Zorn''s Lemma.<br /><br />Today I want to share two mathematical assumptions which are so esoteric that even most mathematicians don''t bother worrying about them. Despite that, they actually critically influence what we think about ethics.<br /><h3>The Axiom of Choice</h3>The Axiom of Choice is everyone''s favorite example of something which seems like an innocuous assumption but isn''t. (The Axiom of Choice is the axiom of choice for such situations, if you will.) Here''s Wikipedia''s informal description:<br /><blockquote class="tr_bq"><span style="background-color: white; color: #252525; font-size: 14px; line-height: 22.3999996185303px;"><span style="font-family: inherit;">The axiom of choice says that given any collection of bins, each containing at least one object, it is possible to make a selection of exactly one object from each bin.</span></span></blockquote>Seems pretty reasonable right? Unfortunately, it leads to a series of paradoxes like that any ball <a href="http://en.wikipedia.org/wiki/Banach%E2%80%93Tarski_paradox">can be doubled</a> into two balls, both of which have the same size as the first.<br /><br />In many cases, a weaker assumption known as the "axiom of dependent choice" suffices and has the advantage of not leading to any (known) paradoxes. Sadly, this doesn''t work for ethics.<br /><br />Consider the two following reasonable assumptions:<br /><br /><ol><li>Weak Pareto: if we can make someone better off and no one worse off, we should.</li><li>Intergenerational Equality: we should value the welfare of every generation equally.</li></ol><br /><b>Theorem </b>(proven by Zame): we cannot prove the existence of an ethical system which satisfies both Weak Pareto and Intergenerational Equality without using the axiom of choice (i.e. the axiom of dependent choice doesn''t work).<br /><br /><table align="center" cellpadding="0" cellspacing="0" class="tr-caption-container" style="margin-left: auto; margin-right: auto; text-align: center;"><tbody><tr><td style="text-align: center;"><a href="http://3.bp.blogspot.com/-5vVL0_OXEEI/VBR-0h_VTNI/AAAAAAAAATQ/AIkb_AWuouw/s1600/kitty_tossup.jpg" imageanchor="1" style="margin-left: auto; margin-right: auto;"><img border="0" src="http://3.bp.blogspot.com/-5vVL0_OXEEI/VBR-0h_VTNI/AAAAAAAAATQ/AIkb_AWuouw/s1600/kitty_tossup.jpg" height="320" width="263" /></a></td></tr><tr><td class="tr-caption" style="text-align: center;">Sorry grandma, but unless you can make that ball double in size we''re gonna have to start means-testing Medicare</td></tr></tbody></table><br /><h3>Hyperreal numbers</h3>The observant reader will note that the previous theorem showed only that we could prove the <i>existence </i>of a "good" ethical system if we use the axiom of choice, it didn''t say anything about us actually being able to find it. To get that we have to enter the exciting world of hyperreal numbers!<br /><br /><table align="center" cellpadding="0" cellspacing="0" class="tr-caption-container" style="margin-left: auto; margin-right: auto; text-align: center;"><tbody><tr><td style="text-align: center;"><a href="http://4.bp.blogspot.com/-ju78L40cWZI/VBRphS6obII/AAAAAAAAAS0/Fxfh2BMrWR4/s1600/Founding-Fathers-I-5135.jpg" imageanchor="1" style="margin-left: auto; margin-right: auto;"><img border="0" src="http://4.bp.blogspot.com/-ju78L40cWZI/VBRphS6obII/AAAAAAAAAS0/Fxfh2BMrWR4/s1600/Founding-Fathers-I-5135.jpg" height="262" width="320" /></a></td></tr><tr><td class="tr-caption" style="text-align: center;">The founding fathers weren''t as impressed with Thomas Jefferson''s original nonconstructive proof that the Bill of Rights could, in theory, be created</td></tr></tbody></table><br />I recently asked my girlfriend whether she would prefer:<br /><ol><li>Having one unit of happiness every day, for the rest of eternity, or</li><li>Having two units of happiness every day, for the rest of eternity</li></ol>She told me that the answer was obvious: she''s a total utilitarian and in the first circumstance she would have one unit of happiness for an infinite amount of time, i.e. one infinity''s worth of happiness. But in the second case she would have two units for an infinite amount of time, i.e. two infinities of happiness. And clearly two infinities are bigger than one.<br /><br />My guess is that how reasonable you think this statement is will depend in a U-shaped way on how much math you''ve learned:<br /><br /><div class="separator" style="clear: both; text-align: center;"><a href="http://4.bp.blogspot.com/-FeQlGJPhvi8/VBRr54jj82I/AAAAAAAAATA/uTzs_6MYDrw/s1600/Reasonableness.png" imageanchor="1" style="margin-left: 1em; margin-right: 1em;"><img border="0" src="http://4.bp.blogspot.com/-FeQlGJPhvi8/VBRr54jj82I/AAAAAAAAATA/uTzs_6MYDrw/s1600/Reasonableness.png" height="368" width="576" /></a></div><div class="separator" style="clear: both; text-align: center;"><br /></div><br />To the average Joe, it''s incredibly obvious that two infinities are bigger than one. More advanced readers will note that the above utility series don''t converge, so it''s not even meaningful to talk about one series being bigger than another. But those who''ve dealt with the bizarre world of <a href="http://en.wikipedia.org/wiki/Non-standard_analysis">nonstandard analysis</a>&nbsp;know that notions like "convergence" and "limit" are conspiracies propagated by high school calculus teachers to hide the truth about infinitesimals. In fact, there is a perfectly well-defined sense in which two infinities are bigger than one, and the number system which this gives rise to is known as the "hyperreal numbers."<br /><br />From an ethical standpoint, here are the relevant things you need to know:<br /><br /><b>Theorem</b> (proven by Basu and Mitra): if we use only our normal "real" numbers, then we can''t construct an ethical system which obeys the above Weak Pareto and Intergenerational Equality assumptions.<br /><b>Theorem</b> (proven by Pivato): we <i>can </i>find such a system if we use the hyperreal numbers.<br /><br />To any TV producers reading this: the success of the hyperreal approach over the "standard calculus" approach would make me an excellent soft-news-show guest. While most stations can drum up some old crotchety guy complaining about how schools are corrupting the minds of today''s youths, only I can actually <b>prove </b>that calculus teaches kids to be unethical.<br /><br /><h3>Conclusion / Apologies / Further Reading</h3><blockquote class="tr_bq"><span style="background-color: white;">As far as the laws of mathematics refer to reality, they are not certain; as far as they are certain, they do not refer to reality. - Einstein</span></blockquote>It goes without saying that I''ve heavily simplified the arguments I''ve cited, and any mistakes are mine. If you are interested in using logical reasoning to improve the world, then you should check out <a href="http://www.effective-altruism.com/">Effective Altruism</a>. If you are more of a "nonconstructive altruist" then you can do a Google scholar search for "sustainable development" or read the papers cited below to learn more.<br /><br />And most importantly: if you are student who is being punished for misbehaving in a calculus class, please 1) tell your teacher the Basu-Mitra-Pivato result about how calculus causes people to disrespect their elders and 2) film their reaction and put it on YouTube. (Now that''s effective altruism!)<br /><br /><ul><li><span style="background-color: white; color: #222222; font-family: Arial, sans-serif; font-size: 13px; line-height: 16.1200008392334px;">Basu, Kaushik, and Tapan Mitra. "Aggregating infinite utility streams with intergenerational equity: the impossibility of being Paretian."&nbsp;</span><i style="background-color: white; color: #222222; font-family: Arial, sans-serif; font-size: 13px; line-height: 16.1200008392334px;">Econometrica</i><span style="background-color: white; color: #222222; font-family: Arial, sans-serif; font-size: 13px; line-height: 16.1200008392334px;">&nbsp;71.5 (2003): 1557-1563.</span></li><li><span style="background-color: white; color: #222222; font-family: Arial, sans-serif; font-size: 13px; line-height: 16.1200008392334px;">Pivato, Marcus. "Sustainable preferences via nondiscounted, hyperreal intergenerational welfare functions." (2008).</span></li><li><span style="background-color: white; color: #222222; font-family: Arial, sans-serif; font-size: 13px; line-height: 16.1200008392334px;">ZAME, WILLIAM R. "Can intergenerational equity be operationalized?."</span><i style="background-color: white; color: #222222; font-family: Arial, sans-serif; font-size: 13px; line-height: 16.1200008392334px;">Theoretical Economics</i><span style="background-color: white; color: #222222; font-family: Arial, sans-serif; font-size: 13px; line-height: 16.1200008392334px;">&nbsp;2 (2007): 187-202.</span></li></ul><div style=''clear: both;''></div></div><div class=''post-footer''><iframe allowTransparency=''true'' frameborder=''0'' scrolling=''no'' src=''http://www.facebook.com/plugins/like.php?href=http://philosophyforprogrammers.blogspot.in/2014/09/ridiculous-math-shit-which-ethics.html&layout=standard&show_faces=false&width=100&action=like&font=arial&colorscheme=light'' style=''border:none; overflow:hidden; width:450px; height:40px;''></iframe><div class=''post-footer-line post-footer-line-1''><span class=''post-comment-link''></span><span class=''post-icons''><span class=''item-control blog-admin pid-1206992745''><a href=''http://www.blogger.com/post-edit.g?blogID=6172724226008713264&postID=475836906009144242&from=pencil'' title=''Edit Post''><img alt='''' class=''icon-action'' height=''18'' src=''//img2.blogblog.com/img/icon18_edit_allbkg.gif'' width=''18''/></a></span></span></div><div class=''post-footer-line post-footer-line-2''><span class=''post-labels''></span></div><div class=''post-footer-line post-footer-line-3''></div></div></div><div class=''comme